import React, { useState } from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

import Layout from "./pages/Layout";
import About from "./pages/About";
import Default from "./pages/Default";
import Dashboard from "./pages/Dashboard";

function App() {
  const [anchorEl, setAnchorEl] = useState(null);
  const [isLoggedIn, setIsLoggedIn] = useState(false); // Agregamos un estado para el inicio de sesión

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleLogin = () => {
    // Simulamos el inicio de sesión
    setIsLoggedIn(true);
    handleClose();
  };

  const handleLogout = () => {
    // Simulamos el cierre de sesión
    setIsLoggedIn(false);
    handleClose();
  };

  return (
    <div>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="menu"
            onClick={handleClick}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" style={{ flex: 1 }}>
            Mi Aplicación
          </Typography>
          {isLoggedIn ? ( // Mostrar las rutas solo si el usuario ha iniciado sesión
            <>
              <Button color="inherit" component={Link} to="/">
                Inicio
              </Button>
              <Button color="inherit" component={Link} to="/photos">
                Fotos
              </Button>
              <Button color="inherit" component={Link} to="/dashboard">
                Panel de Control
              </Button>
            </>
          ) : null}
          {isLoggedIn ? ( // Mostrar opciones de usuario si ha iniciado sesión
            <>
              <Button color="inherit" onClick={handleLogout}>
                <AccountCircleIcon sx={{ marginRight: 1 }} />
                Cerrar Sesión
              </Button>
            </>
          ) : (
            <Button color="inherit" onClick={handleClick}>
              <AccountCircleIcon sx={{ marginRight: 1 }} />
              Iniciar Sesión
            </Button>
          )}
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleClose}
          >
            {isLoggedIn ? (
              <>
                <MenuItem onClick={handleClose}>
                  <AccountCircleIcon sx={{ marginRight: 1 }} />
                  Mi Perfil
                </MenuItem>
                <MenuItem onClick={handleClose}>
                  <AccountCircleIcon sx={{ marginRight: 1 }} />
                  Configuración
                </MenuItem>
              </>
            ) : (
              <MenuItem onClick={handleLogin}>
                <AccountCircleIcon sx={{ marginRight: 1 }} />
                Iniciar Sesión
              </MenuItem>
            )}
          </Menu>
        </Toolbar>
      </AppBar>
      <div>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route path="photos" element={<About />} />
            {isLoggedIn ? (
              <Route path="dashboard" element={<Dashboard />} />
            ) : null}
            <Route path="*" element={<Default />} />
          </Route>
        </Routes>
      </div>
    </div>
  );
}

export default App;
